import React from 'react'

const Nav = (props) => {

    const clickEvent = (e) => {
        e.preventDefault()
    }

    return(
        <>
        <h1>Futbol</h1>
        <button onClick={clickEvent}>Dark</button> 
        </>
    )
}

export default Nav
